import React from "react";
import styled from "styled-components";
import { StyledModal } from "./Modal";
import { Colors } from "../../constants/colors";

const WarningdModal = styled(StyledModal)`
  background-color: rgba(152, 149, 136, 0.7);
`;

const WarningBox = styled.div`
  background-color: white;
  display: flex;
  flex-direction: column;
  border-radius: 40px;
  justify-content: center;
  align-items: center;
  width: 350px;
  color: ${Colors.BLACK};
  padding: 1rem;
`;

export const WarningMessage: React.FC<{ onCloseItself: () => void }> = ({
  onCloseItself
}) => {
  return (
    <WarningdModal>
      <WarningBox>
        <h5>Warning</h5>
      </WarningBox>
    </WarningdModal>
  );
};
